import React from 'react';

import '../../styles/css/fightZone/FightZone.css';
import Tap from './Tap';
import DisplayCountdown from './DisplayCountdown';
import mapFight from '../../styles/assets/newyorkFit.jpg';
import perso1 from '../../styles/assets/guile.gif';
import perso2 from '../../styles/assets/ken.gif';
import ModaleInstructions from './ModaleInstructions';

class FightZone extends React.Component {
  render() {
    return (
      <div className="mapFond">
        <ModaleInstructions />
        <img className="fightMap" src={mapFight} />
        <DisplayCountdown />
        <div className="buttonFight">
          <Tap />
          <Tap />
        </div>
        <div className="fighters">
          <img className="gif2" src={perso2} alt="ken" />
          <img className="gif1" src={perso1} alt="guile" />
        </div>
      </div>
    );
  }
}

export default FightZone;
